selector_to_html = {"a[href=\"https://en.wikipedia.org/wiki/Thomas%27_cyclically_symmetric_attractor\"]": "<img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b5/Thomas%27_cyclically_symmetric_attractor.png/330px-Thomas%27_cyclically_symmetric_attractor.png\" alt=\"Wikipedia thumbnail\" style=\"float:left; margin-right:10px;\"><p>In the dynamical systems theory, <b>Thomas' cyclically symmetric attractor</b> is a 3D strange attractor originally proposed by Ren\u00e9 Thomas. It has a simple form which is cyclically symmetric in the x, y, and z variables and can be viewed as the trajectory of a frictionally dampened particle moving in a 3D lattice of forces. The simple form has made it a popular example.</p>", "a[href^=\"https://en.wikipedia.org/wiki/Thomas%27_cyclically_symmetric_attractor#\"]": "<img src=\"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b5/Thomas%27_cyclically_symmetric_attractor.png/330px-Thomas%27_cyclically_symmetric_attractor.png\" alt=\"Wikipedia thumbnail\" style=\"float:left; margin-right:10px;\"><p>In the dynamical systems theory, <b>Thomas' cyclically symmetric attractor</b> is a 3D strange attractor originally proposed by Ren\u00e9 Thomas. It has a simple form which is cyclically symmetric in the x, y, and z variables and can be viewed as the trajectory of a frictionally dampened particle moving in a 3D lattice of forces. The simple form has made it a popular example.</p>", "a[href=\"https://en.wikipedia.org/wiki/List_of_Runge%E2%80%93Kutta_methods\"]": "<p>\n<b>Runge\u2013Kutta methods</b> are methods for the numerical solution of the ordinary differential equation</p><dl><dd><span class=\"mwe-math-element mwe-math-element-inline\"><img src=\"https://wikimedia.org/api/rest_v1/media/math/render/svg/c93a137a30865114ceb4da94e5692d32ad783b2b\" class=\"mwe-math-fallback-image-inline mw-invert skin-invert\" aria-hidden=\"true\" style=\"vertical-align:-2.005ex;width:13.07ex;height:5.509ex\" /></span></dd></dl>", "a[href^=\"https://en.wikipedia.org/wiki/List_of_Runge%E2%80%93Kutta_methods#\"]": "<p>\n<b>Runge\u2013Kutta methods</b> are methods for the numerical solution of the ordinary differential equation</p><dl><dd><span class=\"mwe-math-element mwe-math-element-inline\"><img src=\"https://wikimedia.org/api/rest_v1/media/math/render/svg/c93a137a30865114ceb4da94e5692d32ad783b2b\" class=\"mwe-math-fallback-image-inline mw-invert skin-invert\" aria-hidden=\"true\" style=\"vertical-align:-2.005ex;width:13.07ex;height:5.509ex\" /></span></dd></dl>", "a[href=\"../glossary.html#term-Uncertainty\"]": "<dt id=\"term-Uncertainty\">Uncertainty</dt><dd><p>An estimate of the standard deviation of a result\nif the analysis would have been repeated many times with independent inputs.\nThis is also known as the standard error.</p></dd>", "a[href=\"../properties/error_estimates.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Uncertainty of the Mean of Time-Correlated Data<a class=\"headerlink\" href=\"#uncertainty-of-the-mean-of-time-correlated-data\" title=\"Link to this heading\">\u00b6</a></h1><p>When data exhibits time correlations,\nthe error of the average cannot be computed by assuming that all data are statistically independent.\nBecause of time correlations, there are fewer independent values than the number of elements in the data.</p><p>Quantifying the <a class=\"reference internal\" href=\"../glossary.html#term-Uncertainty\"><span class=\"xref std std-term\">uncertainty</span></a> of averages over time-correlated data is discussed\nin several textbooks, e.g.,\nAppendix D of \u201cUnderstanding Molecular Simulation\u201d\nby Frenkel and Smit <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id19\" title=\"Daan Frenkel and Berend Smit. Understanding Molecular Simulation. Elsevier, 2002. ISBN 9780122673511. doi:10.1016/b978-0-12-267351-1.x5000-7.\">FS02</a>]</span>,\nor Section 8.4 in the book \u201cComputer Simulation of Liquids\u201d (second edition)\nby Allen and Tildesley <span id=\"id2\">[<a class=\"reference internal\" href=\"../references.html#id31\" title=\"Michael P. Allen and Dominic J. Tildesley. Computer Simulation of Liquids (second edition). Oxford University Press, 2017. ISBN 9780198803195. doi:10.1093/oso/9780198803195.001.0001.\">AT17</a>]</span>.</p>", "a[href=\"../theory/model.html#section-exppoly-target\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">1. ExpPoly Model<a class=\"headerlink\" href=\"#exppoly-model\" title=\"Link to this heading\">\u00b6</a></h2><p>The <a class=\"reference internal\" href=\"../apidocs/stacie.model.html#stacie.model.ExpPolyModel\" title=\"stacie.model.ExpPolyModel\"><span class=\"xref myst py py-class\">ExpPolyModel</span></a> is defined as:</p>", "a[href=\"../properties/autocorrelation_time.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Integrated and Exponential Autocorrelation Time<a class=\"headerlink\" href=\"#integrated-and-exponential-autocorrelation-time\" title=\"Link to this heading\">\u00b6</a></h1><h2>Definitions<a class=\"headerlink\" href=\"#definitions\" title=\"Link to this heading\">\u00b6</a></h2><p>There are two definitions of the autocorrelation time <span id=\"id1\">[<a class=\"reference internal\" href=\"../references.html#id18\" title=\"A. Sokal. Monte Carlo Methods in Statistical Mechanics: Foundations and New Algorithms, pages 131\u2013192. Springer US, Boston, MA, 1997. doi:10.1007/978-1-4899-0319-8_6.\">Sok97</a>]</span>:</p>", "a[href=\"#library-imports-and-matplotlib-configuration\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Library Imports and Matplotlib Configuration<a class=\"headerlink\" href=\"#library-imports-and-matplotlib-configuration\" title=\"Link to this heading\">\u00b6</a></h2>", "a[href=\"#error-of-the-mean\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Error of the Mean<a class=\"headerlink\" href=\"#error-of-the-mean\" title=\"Link to this heading\">\u00b6</a></h2><p>The following cells fit the Lorentz model to the spectrum\nto derive the variance of the mean.</p>", "a[href=\"#spectrum\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Spectrum<a class=\"headerlink\" href=\"#spectrum\" title=\"Link to this heading\">\u00b6</a></h2><p>In the chaotic regime, the low-frequency spectrum indicates diffusive motion:\na large peak at the origin.\nThe spectrum is normalized so that the autocorrelation integral\nbecomes the <a class=\"reference internal\" href=\"../properties/error_estimates.html\"><span class=\"std std-doc\">variance of the mean</span></a>.</p>", "a[href=\"../theory/model.html#section-lorentz-target\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">3. Lorentz Model<a class=\"headerlink\" href=\"#lorentz-model\" title=\"Link to this heading\">\u00b6</a></h2><p>The <a class=\"reference internal\" href=\"../apidocs/stacie.model.html#stacie.model.LorentzModel\" title=\"stacie.model.LorentzModel\"><span class=\"xref myst py py-class\">LorentzModel</span></a> assumes that for large time lags,\n<span class=\"math notranslate nohighlight\">\\(\\Delta_t\\)</span>, the autocorrelation function (ACF) exhibits an exponential decay\nsuperimposed with a white noise background:</p>", "a[href=\"#data-generation\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Data Generation<a class=\"headerlink\" href=\"#data-generation\" title=\"Link to this heading\">\u00b6</a></h2><p>The following cell implements the numerical integration of the oscillator\nusing <a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/List_of_Runge%E2%80%93Kutta_methods#Ralston's_method\">Ralston\u2019s method</a>\nfor 100 different initial configurations.\nThe parameter <span class=\"math notranslate nohighlight\">\\(b\\)</span> is given as an argument to the <code class=\"docutils literal notranslate\"><span class=\"pre\">generate()</span></code> function\nat the last line of the next cell.</p>", "a[href=\"#applicability-of-the-lorentz-model\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Applicability of the Lorentz Model<a class=\"headerlink\" href=\"#applicability-of-the-lorentz-model\" title=\"Link to this heading\">\u00b6</a></h1><p>STACIE\u2019s <a class=\"reference internal\" href=\"../theory/model.html#section-lorentz-target\"><span class=\"std std-ref\">Lorentz model</span></a> assumes that\nthe autocorrelation function decays exponentially for large lag times.\nNot all dynamical systems exhibit this exponential relaxation.\nIf you want to apply STACIE to systems without exponential relaxation,\nyou can use the <a class=\"reference internal\" href=\"../theory/model.html#section-exppoly-target\"><span class=\"std std-ref\">exppoly model</span></a> instead.</p><p>To illustrate the applicability of the Lorentz model,\nthis notebook applies STACIE to numerical solutions of\n<a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Thomas%27_cyclically_symmetric_attractor\">Thomas\u2019 Cyclically Symmetric Attractor</a>:</p>", "a[href=\"#regression-tests\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Regression Tests<a class=\"headerlink\" href=\"#regression-tests\" title=\"Link to this heading\">\u00b6</a></h2><p>If you are experimenting with this notebook, you can ignore any exceptions below.\nThe tests are only meant to pass for the notebook in its original form.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
